import { Navigate, useRoutes } from 'react-router-dom';
// layouts
import DashboardLayout from './layouts/dashboard';
import LogoOnlyLayout from './layouts/LogoOnlyLayout';
//
import Login from './pages/Login';
import Register from './pages/Register';
import DashboardApp from './pages/DashboardApp';
import VisaService from './pages/VisaService';
import Blog from './pages/Blog';
import User from './pages/User';
import NotFound from './pages/Page404';
import Orders from './pages/Orders';
import Team from './pages/Team';
import AddVisaService from './pages/AddVisaService';
import EditVisaService from './pages/EditVisaService';
import EditOrder from './pages/EditOrder';
import EditCategory from './pages/EditCategory';
import MigrationService from './pages/MigrationService';
import EditMigrationService from './pages/EditMigrationService';
import AddMigrationService from './pages/AddMigrationService';
import CompanyInfo from './pages/CompanyInfo';
import EditTeam from './pages/EditTeam';
import AddTeam from './pages/AddTeam';
import EditBlog from './pages/EditBlog';
import AddBlog from './pages/AddBlog';
import Partner from './pages/Partner';
import EditPartner from './pages/EditPartner';
import AddPartner from './pages/AddPartner';
import MainPage from './pages/MainPages';
import EditMainPages from './pages/EditMainPages';
import AddMainPages from './pages/AddMainPages';
import Media from './pages/Media';
import EditMedia from './pages/EditMedia';
import AddMedia from './pages/AddMedia';
import BookGoogleEvent from './pages/BookGoogleEvent';
import Testimonial from './pages/Testimonial';
import EditTestimonial from './pages/EditTestimonial';
import AddTestimonial from './pages/AddTestimonial';
import { LoginForm } from './components/authentication/login';

// ----------------------------------------------------------------------
export default function Router() {
  return useRoutes([
    {
      path: '/dashboard',
      element: localStorage.getItem('isLoggedIn') ? <DashboardLayout /> : <Navigate to="/login" />,
      children: [
        { element: <Navigate to="/dashboard/app" replace /> },
        { path: 'app', element: <DashboardApp /> },
        { path: 'book', element: <BookGoogleEvent /> },

        { path: 'team', element: <Team /> },
        { path: 'orders', element: <Orders /> },

        { path: 'media', element: <Media /> },
        { path: 'media/:id', element: <EditMedia /> },
        { path: 'media/add', element: <AddMedia /> },

        { path: 'testimonial', element: <Testimonial /> },
        { path: 'testimonial/:id', element: <EditTestimonial /> },
        { path: 'testimonial/add', element: <AddTestimonial /> },

        { path: 'partner', element: <Partner /> },
        { path: 'partner/:id', element: <EditPartner /> },
        { path: 'partner/add', element: <AddPartner /> },

        { path: 'page', element: <MainPage /> },
        { path: 'page/:id', element: <EditMainPages /> },
        { path: 'pages/add', element: <AddMainPages /> },

        { path: 'blog', element: <Blog /> },
        { path: 'blog/:id', element: <EditBlog /> },
        { path: 'blog/add', element: <AddBlog /> },

        { path: 'company-info', element: <CompanyInfo /> },

        { path: 'visa-service', element: <VisaService /> },
        { path: 'visa-service/add', element: <AddVisaService /> },
        { path: 'visa-service/:id', element: <EditVisaService /> },

        { path: 'migration-service', element: <MigrationService /> },
        { path: 'migration-service/add', element: <AddMigrationService /> },
        { path: 'migration-service/:id', element: <EditMigrationService /> },

        { path: 'team/add', element: <AddTeam /> },
        { path: 'team/:id', element: <EditTeam /> },
        { path: 'edit-category/:id', element: <EditCategory /> }
      ]
    },
    {
      path: '/',
      element: <LogoOnlyLayout />,
      children: [
        { path: 'login', element: <Login /> },
        { path: 'register', element: <Register /> },
        { path: '404', element: <NotFound /> },
        { path: '/', element: <Navigate to="/dashboard" /> },
        { path: '*', element: <Navigate to="/404" /> }
      ]
    },
    { path: '*', element: <Navigate to="/404" replace /> }
  ]);
}
